import React from 'react'
import styles from './styles.module.css'

export default function Login() {
    const {container, form, inputContainer, input, button} = styles

    const inputs = document.querySelectorAll(".input");

function focusFunc(this: any) {
  let parent = this.parentNode;
  parent.classList.add("focus");
}

function blurFunc(this: any) {
  let parent = this.parentNode;
  if (this.value === "") {
    parent.classList.remove("focus");
  }
}

inputs.forEach((input) => {
  input.addEventListener("focus", focusFunc); //input geht hoch
  input.addEventListener("blur", blurFunc); //input wieder zurück
});

  return (
    <div className={container}>
        <div className={form}>
        <form>
        <h2>Login</h2>
        <div className={inputContainer}>
        <input type="email" name="email" className={input} required />
            <label>Email</label>
            <span>Email</span>
        </div>
        <div className={inputContainer}>
        <input type="password" name="password" className={input} required />
            <label>Password</label>
            <span>Password</span>
        </div>
        <input type="submit" value="Send" className={button} />
        </form>
        </div>
    </div>
  )
}
